import Header from "../components/Header";
import Button from "../components/Button";
// import Body from "../components/Body";
import { useNavigate } from "react-router-dom";
import React from "react";
import Modal from "react-modal";

const TestMain = ({role}) => {
    const navigate = useNavigate();
    const [modalIsOpen, setModalIsOpen] = useState(false);
    
    const goTest = () => {
        if(role === ""){
            navigate(`/login`);
        } else if(role === "USER"){
            navigate(`/main`);
        } else if(role === "NOT_TEST_USER"){
            navigate(`/test`);
        } else {
            navigate(`/set_profile`);
        }
    }
    return (
        <div>
            <Header title={"테스트 시작 페이지"}/>
            <Button text={"테스트 시작하기"} onClick={goTest}/>
            <Modal ariaHideApp={false} isOpen={modalIsOpen} onRequestClose={() => setModalIsOpen(false)}>    
                {/* <div className="profile_list_wrapper">
                    {profileImgList.map((it) => (
                        <ProfileItem
                            key={it.id}
                            {...it}
                            onClick={handleChangeSelection}
                            isSelected={state.profileId === it.id}
                        />
                    ))}
                </div> */}
                <div><Button text="완료" onClick={setModalIsOpen(false)}/></div>
            </Modal>
        </div>
    )
}

export default TestMain;
